function changeLanguage(lang) {
    const elements = Object.keys(translations[lang]);
    elements.forEach((id)=>{
        const element = document.getElementById(id);
        if (element) element.textContent = translations[lang][id] || '';
    });
    document.getElementById('list').classList.remove('displayOptions');
}
function showNextImage() {
    document.getElementById('slider').style = 'transform: translate(0%)';
    document.getElementById('buttonNext').classList.toggle('buttonActive');
    document.getElementById('buttonPrev').classList.toggle('buttonActive');
}
function showPrevImage() {
    document.getElementById('slider').style = 'transform: translate(-100%)';
    document.getElementById('buttonPrev').classList.toggle('buttonActive');
    document.getElementById('buttonNext').classList.toggle('buttonActive');
}
function showAboutNextImage() {
    document.getElementById('sliderAbout').style = 'transform: translate(0%)';
    document.getElementById('aboutButtonNext').classList.toggle('buttonActive');
    document.getElementById('aboutButtonPrev').classList.toggle('buttonActive');
    document.getElementById('aboutDotNext').classList.toggle('dotActive');
    document.getElementById('aboutDotPrev').classList.toggle('dotActive');
}
function showAboutPrevImage() {
    document.getElementById('sliderAbout').style = 'transform: translate(-100%)';
    document.getElementById('aboutButtonPrev').classList.toggle('buttonActive');
    document.getElementById('aboutButtonNext').classList.toggle('buttonActive');
    document.getElementById('aboutDotPrev').classList.toggle('dotActive');
    document.getElementById('aboutDotNext').classList.toggle('dotActive');
}
function changeText() {
    document.querySelectorAll('.wrapper-button').forEach((item)=>{
        if (item.classList.contains('wrapperButtonActive')) item.textContent = '-';
        else item.textContent = '+';
    });
}
function displayInfo(infoId, buttonId) {
    const infoElements = document.querySelectorAll('[id^="wrapper-info"]');
    const buttonElements = document.querySelectorAll('[id^="wrapperButton"]');
    infoElements.forEach((info)=>{
        if (info.id === infoId) info.classList.toggle('displayedInfo');
        else info.classList.remove('displayedInfo');
    });
    buttonElements.forEach((button)=>{
        if (button.id === buttonId) button.classList.toggle('wrapperButtonActive');
        else button.classList.remove('wrapperButtonActive');
    });
    buttonElements.forEach((button)=>{
        if (button.classList.contains('wrapperButtonActive')) button.textContent = '-';
        else button.textContent = '+';
    });
}
function displayMenu() {
    document.getElementById('menuMobile').classList.toggle('displayMenu');
    document.getElementById('body').classList.toggle('removeScroll');
}
function displayOptions() {
    document.getElementById('list').classList.toggle('displayOptions');
}
window.addEventListener('scroll', ()=>{
    const viewportHeight = window.innerHeight;
    const scrolly = window.scrollY;
    const isScrollStarted = window.scrollY > 10;
    if (scrolly >= viewportHeight) document.getElementById('arrowUp').classList.add('arrowDisplayed');
    else document.getElementById('arrowUp').classList.remove('arrowDisplayed');
    if (isScrollStarted) document.getElementById('header').classList.add('headerScrolled');
    else document.getElementById('header').classList.remove('headerScrolled');
});
document.addEventListener('DOMContentLoaded', ()=>{
    changeLanguage('en');
    changeText();
    document.getElementById('lang').addEventListener('click', ()=>displayOptions());
    document.getElementById('en').addEventListener('click', ()=>changeLanguage('en'));
    document.getElementById('ua').addEventListener('click', ()=>changeLanguage('ua'));
    document.getElementById('buttonPrev').addEventListener('click', ()=>showNextImage());
    document.getElementById('buttonNext').addEventListener('click', ()=>showPrevImage());
    document.getElementById('aboutButtonPrev').addEventListener('click', ()=>showAboutNextImage());
    document.getElementById('aboutDotPrev').addEventListener('click', ()=>showAboutNextImage());
    document.getElementById('aboutButtonNext').addEventListener('click', ()=>showAboutPrevImage());
    document.getElementById('aboutDotNext').addEventListener('click', ()=>showAboutPrevImage());
    document.getElementById('wrapperButton1').addEventListener('click', ()=>displayInfo('wrapper-info1', 'wrapperButton1'));
    document.getElementById('wrapperButton2').addEventListener('click', ()=>displayInfo('wrapper-info2', 'wrapperButton2'));
    document.getElementById('wrapperButton3').addEventListener('click', ()=>displayInfo('wrapper-info3', 'wrapperButton3'));
    document.getElementById('burger').addEventListener('click', ()=>displayMenu());
    document.getElementById('close').addEventListener('click', ()=>displayMenu());
    document.querySelectorAll('.menu__nav-link').forEach((link)=>link.addEventListener('click', ()=>displayMenu()));
    document.getElementById('contactUsButton').addEventListener('click', function(event) {
        event.preventDefault();
        const name = document.getElementById('contactUsName');
        const email = document.getElementById('contactUsEmail');
        const phone = document.getElementById('contactUsPhone');
        const message = document.getElementById('contactUsMessage');
        const formMessage = document.getElementById('formMessage');
        let isValid = true;
        [
            name,
            email,
            phone,
            message
        ].forEach((input)=>{
            if (!input.value.trim()) {
                isValid = false;
                input.classList.add('error');
            } else {
                input.classList.remove('error');
                formMessage.classList.remove('errorMessage');
            }
        });
        if (isValid) {
            formMessage.classList.remove('errorMessage');
            formMessage.textContent = 'Form submitted successfully!';
            // document.querySelector('.contactUs__form').submit();
            [
                name,
                email,
                phone,
                message
            ].forEach((input)=>{
                input.value = '';
                input.ariaAutoComplete = '';
            });
            setTimeout(()=>formMessage.textContent = '', 1000);
        } else {
            formMessage.textContent = 'Please fill out all required fields!';
            formMessage.classList.add('errorMessage');
        }
    });
});

